public class conditionaloperatorexample {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//conditional operator &&, //
		int x=10;
		int y=20;
		int z=30;
		if(x<y && y<z)
		System.out.println("greater"+z);
		if(x<y ||y<z);
		System.out.println("greater"+z);

	}

}
